import React from 'react';
import { NavLink } from "react-router-dom";
import logo from "./../../img/logo-white.png"; // Make sure the path to your logo is correct
import './Header.css'; // Make sure the path to your CSS file is correct

const Header = () => {
    return (
        <header className="Header">
            <NavLink to="/" className="logo-link">
                <img src={logo} alt="logo" className="logo" />
            </NavLink>
            <nav className="navigation">
                <NavLink to="/University" className="nav-link">УНИВЕРСИТЕТ</NavLink>
                <NavLink to="/Korpusa" className="nav-link">КОРПУСА</NavLink>
                <NavLink to="/Musei" className="nav-link">МУЗЕИ</NavLink>
                <NavLink to="/Dendrik" className="nav-link">ДЕНДРАРИЙ</NavLink>
            </nav>
        </header>
    );
};

export default Header;
